INSERT INTO `curso` VALUES (14,'Especialización en Formulación de Proyectos de Innovación','prin_1649984515.png','https://youtu.be/huEKCczWJm8','sec_1649984010.jpeg','pago',320,40,300.00,2,'Las clases serán 100% virtuales, con 02 sesiones por semana. Con la especialización los participantes multiplicaran sus capacidades en formulación de proyectos de Innovación.','CAMPUS VITUAL E- LEARNING. Los participantes del curso tendrán a su disposición nuestra plataforma virtual, donde podrán interactuar, aprender y compartir contenido, junto a nuestros especialistas con experiencia profesional y amplio conocimiento en su materia.\r\nPLATAFORMA VIRTUAL E-COMERCE. Realiza tu compra rápida y segura a través de nuestra PLATAFORMA SEGURA DE PAGOS ONLINE.\r\nEstamos validados por CULQI y aceptamos todas las tarjetas','2021-02-13','2021-06-26','1','Especialista en Identificación y Formulación de Proyectos de Innovación','1','1','1','b_form_proyectos.pdf','1','2021-01-27 11:54:53','2022-04-14 20:01:55',1),(15,'Programa de Especialización en Acuicultura Amazónica','1611944414.png','https://youtu.be/WD1AvA_31PM','acui-portada.jpg','pago',320,40,300.00,1,'La especialización consta de 04 cursos claves en la acuicultura, que se desarrollarán en 40 sesiones.\r\nLas clases serán 100% virtual, 02 sesiones por semana , al finalizar el programa de capacitación se espera que los participantes cuenten con altos niveles de competencia en acuicultura amazónica, con énfasis en sanidad, técnicas de reproducción y tecnologías de producción intensiva.','CERTIFICADO: Certificación oficial como “Especialista en Acuicultura Amazónica” a nombre del INSTITUTO DE INVESTIGACIONES DE LA AMAZONÍA PERUANA.\r\nMETODOLOGÍA: Las clases serán 100% virtual, 02 sesiones por semana , al finalizar el programa de capacitación se espera que los participantes\r\ncuenten con altos niveles de competencia en acuicultura amazónica, con énfasis en sanidad, técnicas de reproducción y tecnologías de producción intensiva.\r\nLa especialización consta de 04 cursos claves en la acuicultura, que se desarrollarán en 40 sesiones.','2021-02-16','2021-06-30','1','Especialista en Acuicultura Amazónica.','1','1','1','b_acui_amazonica.pdf','1','2021-01-29 13:20:14','2021-02-15 11:25:37',1),(16,'Redacción de artículos científicos para publicación en revistas indexadas','prin_1620080758.jpg',NULL,'frm-portada.jpg','gratis',6,3,0.00,3,'El participante después del evento, saldrá con conocimientos y criterios elementales en las temáticas de redacción, procesamiento estadístico de los datos y publicación de artículos científicos en revistas nacionales e internacionales indexadas.','El curso taller será 100% virtual, durante 3 días; se desarrollará una sesión por día (120 minutos). Con este curso los participantes lograrán ampliar sus conocimientos y capacidad investigativa, sobresaliendo en la redacción y publicación de artículos científicos.','2021-05-04','2021-05-06','2',NULL,'1','1','1',NULL,'1','2021-05-03 17:25:58','2021-05-03 17:25:58',1),(17,'Workshop Biología computacional','prin_1620919652.jpg',NULL,'frm-portada.jpg','pago',10,6,300.00,3,'El participante después del evento, tendrá los conocimientos y habilidades básicas en computación de alto rendimiento, programación en Python, investigación de fármacos asistido por computadoras y simulación de sistemas biológicos para solucionar problemas de interés en salud pública.','El workshop será 100% virtual, un módulo por día con una duración de 120 minutos. comprenderá módulos teóricos y prácticas virtuales, tiene como objetivo brindar a los investigadores de las diferentes áreas de la ciencias biológicas, las herramientas y habilidades necesarias en programación en Python, simulación de sistemas biológicos y diseño racional de fármacos, de la mano con el avance de las tecnologías de vanguardia; como el uso de la supercomputadora MANATI del IIAP, que gracias a sus grandes capacidades computacionales puede realizar  cálculos complejos de sistemas biológicos,  que brindan una aproximación más real a las simulaciones por computadora. Por otro lado, la reciente pandemia por COVID-19 pone de manifiesto la necesidad de desarrollar habilidades en bioinformática y biología computacional que en el contexto actual son determinantes para la investigación y solución de problemas en salud pública; como el desarrollo vacunas y sistemas de diagnóstico molecular','2021-05-31','2021-06-05','1',NULL,'1','1','1','b_computacional.pdf','1','2021-05-13 10:27:32','2021-05-13 10:27:32',1),(18,'El Ciclo del carbono en la Amazonía','prin_1661201659.png','https://youtu.be/i96rlubD3B8','sec_1661201659.png','gratis',6,17,0.00,3,'Este curso será 100% virtual, para lo cual se desarrollaran 5 unidades, con un tiempo de duración de 6 horas totales, estando disponible desde el 28 de agosto del 2022.','En este curso, ofrecido por el IIAP, conocerás todo acerca del ciclo del carbono, desde las características, tipos, etapas, el impacto humano que hay dentro de ello hasta la relación que hay y existe con el cambio climático.\r\nComprenderás la importancia del ciclo del carbono y las funciones que cumple en el ambiente y en nuestras vidas. Reconocerás que la Amazonía influye mucho en el ciclo del carbono y los impactos que hay acerca de ello.','2022-08-28','2022-10-03','1','El Ciclo del carbono en la Amazonía','1','1','1','bro_1661154681.pdf','1','2022-08-12 12:56:36','2022-08-22 15:54:18',1),(19,'Cambio Climático en la Amazonía','prin_1661531007.png','https://youtu.be/uf35kVQ7E4E','sec_1661531007.png','gratis',4,10,0.00,3,'Los cursos son con duración de 45 minutos de cada módulo, en total 3h 45 min en la semana, para realizar todas las actividades y cuestionarios de evaluación.','Este curso ofrecido por el IIAP consta con 5 módulos, donde verás temas sobre de que trata el cambio climático, cómo está afectando en el mundo, como afecta a los países, en nuestro país y la Amazonía.','2022-08-28','2022-10-03','1','Cambio Climático en la Amazonía','1','1','1','bro_1660824956.pdf','1','2022-08-18 07:15:56','2022-09-07 11:22:31',1),(20,'Certificado CONIAP 2022 como asistente','prin_1669412721.jpeg','http://capacitandome.iiap.gob.pe/admin/course/nuevo','sec_1669412721.jpeg','pago',5,4,20.00,3,'Certificado de CONIAP 2022','Certificado de CONIAP 2022','2022-11-23','2022-11-25','1','Certificado de CONIAP 2022','1','2','1','bro_1669412721.pdf','1','2022-11-25 16:45:21','2022-11-25 16:45:21',2),(21,'Certificado CONIAP 2022 como ponente (ponencia corta)','prin_1669733023.jpeg','https://www.youtube.com/watch?v=lqQjpnYnnFE','sec_1669733023.jpeg','pago',3,5,20.00,3,'Certificado CONIAP 2022 como ponente (ponencia corta)','Certificado CONIAP 2022 como ponente (ponencia corta)','2022-11-23','2022-11-25','2','Certificado CONIAP 2022 como ponente (ponencia corta)','1','1','1','bro_1669733023.pdf','1','2022-11-29 09:43:43','2022-11-29 09:43:43',2);
